import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import App from './App';
import { CardProvider } from './context/CardContext'; // Ensure this path is correct

ReactDOM.render(
  <CardProvider>
    <Router>
      <App />
    </Router>
  </CardProvider>,
  document.getElementById('root')
);
